insert  into `speciallisttext`(`LineNo`,`TextLine`) values (1,'Dear Sir or Madam'),(2,''),(3,'IE Domain Registry Ltd (IEDR) has now issued you with an invoice'),(4,'for the renewal of the above domain name for the period July'),(5,'2008 to July 2009.  This is due to be paid by Sunday 31st of'),(6,'August 2008.'),(7,''),(8,'If you have any queries in relation to the above please contact'),(9,'Brian Taite on 00353 1 2365422 or alternatively email'),(10,'accounts-team@domainregistry.ie'),(11,''),(12,'To submit payment for your invoice you can:-'),(13,'1) Pay online by credit card via our website at:'),(14,'www.iedr.ie/Payments by Sunday 31/08/2008.'),(15,''),(16,'2) Send a Cheque or make a Credit Transfer before 29/08/2008'),(17,'(Please allow 2 working days for transmission).'),(18,''),(19,'Our details are as follows:'),(20,''),(21,'IE Domain Registry Ltd, Windsor House,'),(22,'14 Windsor Terrace, Sandycove'),(23,'Co Dublin'),(24,''),(25,'IBAN  IE 81 BOFI 9013 5112 8531 82'),(26,'BIC   BOFIIE2D'),(27,''),(28,'(Note if making payment by credit transfer please enter either'),(29,'your Account Number, Invoice Number or domain name.)'),(30,''),(31,'Why you should renew your .ie domain?'),(32,'Protect your on-line identity:  Your .ie address is your unique'),(33,'on-line identification of who you are, what you do and where'),(34,'your business is located.  A .ie address demonstrates that you'),(35,'are doing business in or from Ireland.'),(36,''),(37,'Having a .ie address conveys to your customers that you are'),(38,'a credible trusted organisation.  This naturally increases their'),(39,'confidence in conducting business on-line.');

