 you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have invested significant time, effort, or resources in the product or service that directly relates to the proposed domain name. \r\n\r\n- Where the domain name relates to a proposed non-commercial project, information showing that the applicant has invested significant time, effort, or resources in a project that directly relates to the proposed domain name. \r\n\r\n- High quality brochure/promotional material or other demonstration of significant investment in the project, expo, or event may be sufficient.\r\n\r\nPlease further note that if the applicant is intending to trade under this name we will require an RBN.\r\n\r\nTYPE: Reg - info required\r\nCODE: [1.13]\r\n',NULL,NULL,'2008-07-23 15:45:38','N','N',0,'N'),(257653,'R','socialmedia.ie',NULL,'Lorcan Rynne',NULL,00000261,NULL,'Discretionary Applicant','Discretionary Name','Supporting criteria will be forwarded.','AHK661-IEDR',NULL,'',NULL,'JL304-IEDR',NULL,'ABF578-IEDR',NULL,'ABF578-IEDR','NS1.STORMWEBHOST.COM',NULL,'',NULL,'NS2.STORMWEBHOST.COM',NULL,'',NULL,'NS3.STORMWEBHOST.COM',NULL,'',NULL,3,'2008-07-23',0,'0000-00-00','N',NULL,NULL,NULL,'2008-07-23 17:51:33','Thank you for your application. To proceed with registration under the discretionary name category we will require information supporting the applicants claim on the domain name. Examples of discretionary name applications is as follows:\r\n\r\n- Where a company or a business applies for a name that relates to a product or service that is not yet in the public domain, the applicant must submit information showing that they have inves